function Card(props) {
  return (
    <div>
      <h2>{props.name}</h2>
      <img src={props.img} alt="avatar_img" />
      <p></p>
      <p>{props.email} </p>
    </div>
  );
}

function App() {
  return (
    <div style={{ marginLeft: 100 }}>
      <h1>My Contacts</h1>
      <Card
        name="Hima Das"
        img="https://im.rediff.com/sports/2018/apr/10hima.jpg?w=300&h=400"
        tel="+123 456 789"
        email="himadas@india.com"
      />
    </div>
  );
}

export default App;
